import React, { useState } from "react";
import Grid from "@material-ui/core/Grid";
import { Typography, Paper, makeStyles, Toolbar, Card, CardMedia, IconButton } from "@material-ui/core";
import UpdateIcon from '@material-ui/icons/Update';

import AppHeader from "../components/AppHeader";
import AppDrawer from "../components/AppDrawer";
import SurveyCard from "../components/SurveyCard";
import styles from "../styles/HomePageStyle";

const useStyles = makeStyles(styles);


export default function Home() {

  const classes = useStyles();

  const [drawerOpen, setDrawerOpen] = useState(false);


  const handleDrawerOpen = (e) => {
    setDrawerOpen(true);
  }

  const handleDrawerClose = e => {
    setDrawerOpen(false);
  }

  return (
    <React.Fragment>

      <AppHeader handleDrawerOpen={handleDrawerOpen} drawerOpen={drawerOpen} />
      <AppDrawer open={drawerOpen} handleDrawerClose={handleDrawerClose} />
      <Toolbar />


     
      
      <Toolbar>
        <Grid container direction="row" alignItems="flex-start" >
        <Grid item sm={1} md={2} lg={2}></Grid>
        <Grid item flex-grow={1} className={classes.listHead}>
          <Typography variant="h6">Recent Forms</Typography>
        </Grid>
        <Grid item>
          <IconButton color="primary">
            <UpdateIcon />
          </IconButton>
        </Grid>
        <Grid item sm={1} md={2} lg={2}></Grid>
        </Grid>
      </Toolbar>

     <Grid 
      container 
      direction="column" 
      alignItems="center" 
      spacing={2} 
      className={classes.mainArea}
    >     
      <Grid item>
        <Card>This is main area</Card>
      </Grid>
      <Grid item sm={10} lg={8} md={8}>
        <Card >
          This is main area
        </Card>
      </Grid>
      <Grid item sm={10} lg={8} md={8}>
        <Paper >
